import * as React from 'react';

import Github from '../images/icons/github.png';
import Linkedin from '../images/icons/linkedin.png';

const Icons = (props) => {
  return (
    <div className='icons'>
      <div className='github-icon'><img src={Github} alt='Gh'/></div>
      <div className='linkedin-icon'><img src={Linkedin} alt='In'/></div>
    </div>
  );
}

export default Icons;
